contract Globals {

    // the protocol fee 
    uint protocolFee;

    struct DexParams {
        bytes32             dex;
        IUniswapV2Router02  v2Router;
        IUniswapV2Factory   v2Factory;
        ISwapRouter         v3Router; 
        IUniswapV3Factory   v3Factory;
        uint256             createdAt;
        bool                enabled; 
    }

}","keccak256":"0xdf4caaae6f5f01efd20112c937ca3eab1b44d0cd7c88c8dcd4e76ffb6d5e3f97","license":"GPL-2.0-or-later"},"contracts/core/SwapEngine.sol":{"content":"// SPDX-License-Identifier: GPL-2.0-or-later
pragma solidity ^0.8.0;

import "../ContractBase.sol";

contract SwapEngine is ContractBase {

    bool initialized; 

    // dexId Uint => Dex Params 
    mapping (bytes32 => DexParams) public dexesParams;
    bytes32[] public dexes;


    function addDex(
        bytes32 dex,
        IUniswapV2Router02 uniV2Router, 
        ISwapRouter        uniV3Router,
        address            uniV3Factory,
        bool               enabled
    ) 
        public 
        onlyOwner 
    {

        bool isNew = (dexesParams[dex].createdAt == 0);

        address v2FactoryAddr = (address(uniV2Router) == address(0))
                                ? address(0) 
                                : uniV2Router.factory();

        uint createdAt = (isNew) ? block.timestamp : dexesParams[dex].createdAt;

        dexesParams[dex] = DexParams(
            dex,
            uniV2Router,
            IUniswapV2Factory(v2FactoryAddr),
            ISwapRouter(uniV3Router),
            IUniswapV3Factory(uniV3Factory),
            createdAt,
            enabled
        );

        if(isNew) dexes.push(dex);

    }

}","keccak256":"0xdbfd7d6063d21d3ae94c38033fc494a6bb49eb3f8fb7bfbecdd14bbb0f557a73","license":"GPL-2.0-or-later"},"contracts/interfaces/@uniswap/v2/v2-core/interfaces/IUniswapV2Factory.sol":{"content":"// SPDX-License-Identifier: GPL-2.0-or-later
